'    p_region              in apex_plugin.t_region,',
'    p_plugin              in apex_plugin.t_plugin,',
'    p_is_printer_friendly in boolean',
') return apex_plugin.t_region_render_result is',
'begin',
'',
'    apex_javascript.add_onload_code(''qrCodeScanner(apex, $, Html5Qrcode, Html5QrcodeSupportedFormats).initialize( {'' ||',
'        apex_javascript.add_attribute(p_name => ''regionID'', p_value => p_region.static_id, p_add_comma => true ) ||',
'        apex_javascript.add_attribute(p_name => ''height'', p_value => p_region.attribute_06, p_add_comma => true ) ||',
'        apex_javascript.add_attribute(p_name => ''resultMode'', p_value => to_number(p_region.attribute_02), p_add_comma => true ) ||',
'        apex_javascript.add_attribute(p_name => ''executeJavaScript'', p_value => p_region.attribute_03, p_add_comma => true ) ||',
'        apex_javascript.add_attribute(p_name => ''setItem'', p_value => p_region.attribute_04, p_add_comma => true ) ||',
'        apex_javascript.add_attribute(p_name => ''disableNumberConversion'', p_value => case when p_region.attribute_05 = ''Y'' then true else false end, p_add_comma => true ) ||',
'        apex_javascript.add_attribute(p_name => ''mirrorCamera'', p_value => case when p_region.attribute_08 = ''Y'' then true else false end, p_add_comma => true ) ||',
'        apex_javascript.add_attribute(p_name => ''scanFormats'', p_value => p_region.attribute_07, p_add_comma => true ) ||',
'        apex_javascript.add_attribute(p_name => ''facingMode'', p_value => p_region.attribute_09, p_add_comma => false ) ||',
'    ''} );'');',
'',
'    return null;',
'end;'))
