,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<p>This Region Plug-in is used to scan codes. If any string has been detected an APEX Item can be set, Dynamic Action can be fired or JavaScript can be executed.</p>',
'<p>The following formats are supported: QR_CODE, AZTEC, CODABAR, CODE_39, CODE_93, CODE_128, DATA_MATRIX, MAXICODE, ITF, EAN_13, EAN_8, PDF_417, RSS_14, RSS_EXPANDED, UPC_A, UPC_E, UPC_EAN_EXTENSION</p>',
'<p>To control the QR Code Scanner you can fire events on th QR Code region. The following events are supportet:</p>',
'<ul>',
'<li>apex.region("region_id").pause(); => stop Scanner Video</li>',
'<li>apex.region("region_id").start(); => start Scanner video</li>',
'<li>apex.region("region_id").refresh(); => reset the currentValue and the item</li>',
'<li>apex.region("region_id").setFacingMode(); => change camera</li>',
'</ul>'))
